import React from 'react';
import "./Platform.css" ;
import PlatformNav from "../PlatformNav/PlatformNav";
import Contacts from '../Modules/Contacts/Contacts';

const Platform = () => {
    return (
        <>
        <div className='gray-600'>
        <PlatformNav />
        <Contacts></Contacts>
        </div>
            
        </>
    );
}

export default Platform;
